<html>
    <head>
        <link rel="stylesheet" href="/css/_variables.css">
        <style type="text/css"> 
        body {
            display:flex;
            flex-grow: 1;
            align-items: center;
            justify-content: center;
            font-family: Lato;
        }
         .card {
            max-width: 480px;
            background-color: var(--c24-global-subhigh);
            border-radius: 6px;
            padding:  var(--c24-global-spacing-l);
            box-shadow: 5px 10px 20px rgba(3,41,76,0.1);
            height: auto;
        } 
        .wrapper {
            position: relative;
            display:flex;
            flex-direction: column;
            flex-grow: 1;
            align-items: center;
        }
        .stack {
            display: flex;
            flex-direction: column;
            align-items: center;
            margin: 0;
            gap: var(--c24-global-spacing-s);
            margin-top: var(--c24-global-spacing-m);
        }
        h3, p {
            margin: 0;
            padding: 0;
            color: var(--c24-global-text);
        }
        .image {
            width: 50%;
        }
        .close-icon{
            position: absolute;
            top: -16px;
            right: -16px;
        }
        button {
            margin-top: var(--c24-global-spacing-m);
            background-color: var(--c24-global-primary);
            height: var(--c24-global-size-l);
            border: none;
            color: var(--c24-global-white);
            font-size: 15px;
            padding: 0 var(--c24-global-spacing-s);
            border-radius: 4px;
            font-weight: 400;
        }
        .svgfill {
            fill: var(--c24-global-primary);
        }
        h3 {
            font-size: 24px;
        }
        p {
            font-size: 14px; line-height: 21px;
        }
        .masonry {
            width: 100%; 
            height: 100%;
            display: flex;
            flex-wrap: wrap;
            flex-direction: row;
            justify-content: space-between;
            align-content: space-between;
            gap: var(--c24-global-spacing-xl);

        ;}
        </style>
    </head>
